Generated by gemini.google.comMaterial Design, Googles design system, has continuously evolved to provide a better user experience. The latest iteration, **Material 3**, introduces a new approach called **Expressive Design**. According to Googles [research on expressive design](https://design.google/library/expressive-material-design-google-research), expressive design aims to make UIs more human.

Expressive Design focuses on several key elements. It uses a richer, more detailed **color palette** to emphasize key elements and create visual hierarchy. A variety of **shapes and corner** are employed to direct user focus and establish a unique visual tone. **Size variations** are leveraged to draw attention to important UI elements. **Fluid and natural animations** enhance interactions and provide delightful feedback. **Containers strategically used** to group related elements and improve clarity.

# New Components for Android
[**Material 3**](https://m3.material.io/blog/building-with-m3-expressive) introduces several new and updated components that embody the principles of Expressive Design. These components provide developers with more tools to create engaging and user-friendly interfaces.

To provide a practical understanding of these enhancements, Ive explored the updated components and their implementation. This article is structured in two parts: the first, presented here, covers **loading indicators**, **split buttons**, and **button groups**. A subsequent article will focus on **toolbars**, which have significant updates. All the examples discussed here are available in my [**GitHub repository**](https://github.com/stefanoq21/ComposePlayground).

To get started with the latest Material 3 features, ensure your projects **gradle** file is updated with the necessary dependencies. The following snippet demonstrates how I updated the **material3** version:

[versions]material3 = "1.4.0-alpha14"[libraries]androidx-material3 = { group = "androidx.compose.material3", name = "material3", version.ref = "material3"

## Loading indicators
**Loading indicators** are visual signals that inform the user that a process is underway. They are essential for providing feedback during operations such as fetching data, processing information, or loading content.

Instead of the standard **CircularProgressIndicator**, Material 3&#x27;s expressive design introduces two new components: **LoadingIndicator **and **ContainedLoadingIndicator**. These offer enhanced visual styling and behavior for a more engaging user experience.

The **LoadingIndicator()** animates and morphs between various shapes as long as it is visible.

The **ContainedLoadingIndicator()** is similar, but its shapes are contained within a colored **containerShape**.

For both **LoadingIndicator()** and **ContainedLoadingIndicator()**, you can customize the animated shapes using the **polygons **parameter and their colors, like this:

LoadingIndicator( color = Color.Blue, polygons = listOf( // MaterialShapes.SoftBurst, // MaterialShapes.Cookie9Sided, // MaterialShapes.Pentagon, MaterialShapes.Pill, // MaterialShapes.Sunny, // MaterialShapes.Cookie4Sided, MaterialShapes.Oval ))For **ContainedLoadingIndicator()**, you can also modify the container&#x27;s appearance with the **containerShape** parameter:

ContainedLoadingIndicator( containerShape = MaterialShapes.Pill.toShape())By effectively using loading indicators, you can create a more responsive and user-friendly experience in your Android applications.

## Split buttons
A **SplitButtonLayout **lets the user define a button group consisting of two buttons. The **leading button** performs a primary action, and the **trailing button** performs a secondary action that is contextually related to the primary action. This UI pattern is particularly useful when a user needs quick access to a frequently used action but also needs the flexibility to choose from a set of related options.

Heres an example of a split button with a menu offering secondary actions:

var checked2 by remember { mutableStateOf(false) }Box( modifier = Modifier .fillMaxSize() .wrapContentSize()) { SplitButtonLayout(leadingButton = { SplitButtonDefaults.LeadingButton( onClick = { }, ) { Icon( Icons.Filled.Edit, modifier = Modifier.size(SplitButtonDefaults.LeadingIconSize), contentDescription = "Localized description", ) Spacer(Modifier.size(ButtonDefaults.IconSpacing)) Text("My Button") } }, trailingButton = { SplitButtonDefaults.TrailingButton( checked = checked2, onCheckedChange = { checked2 = it }, ) { val rotation: Float by animateFloatAsState( targetValue = if (checked2) 180f else 0f, label = "Trailing Icon Rotation" ) Icon( Icons.Filled.KeyboardArrowDown, modifier = Modifier .size(SplitButtonDefaults.TrailingIconSize) .graphicsLayer { this.rotationZ = rotation }, contentDescription = "Localized description" ) } }) DropdownMenu(expanded = checked2, onDismissRequest = { checked2 = false }) { DropdownMenuItem( text = { Text("Edit") }, onClick = {}, leadingIcon = { Icon(Icons.Outlined.Edit, contentDescription = null) }) DropdownMenuItem( text = { Text("Settings") }, onClick = {}, leadingIcon = { Icon(Icons.Outlined.Settings, contentDescription = null) }) HorizontalDivider() DropdownMenuItem( text = { Text("Send Feedback") }, onClick = {}, leadingIcon = { Icon(Icons.Outlined.Email, contentDescription = null) }}You can customize the leading and trailing buttons using your own composables or by constructing them with three different styles: **SplitButtonDefaults.LeadingButton**, **SplitButtonDefaults.OutlinedLeadingButton** and **SplitButtonDefaults.ElevatedLeadingButton**.

Heres an example of a customized **SplitButton **with two different styles applied to the leading and trailing buttons:

var checked by remember { mutableStateOf(false) }SplitButtonLayout( modifier = Modifier.fillMaxWidth(), leadingButton = { SplitButtonDefaults.OutlinedLeadingButton( onClick = { }, ) { Icon( Icons.Filled.Edit, modifier = Modifier.size(SplitButtonDefaults.LeadingIconSize), contentDescription = null, ) Spacer(Modifier.size(ButtonDefaults.IconSpacing)) Text("My Button") }}, trailingButton = { SplitButtonDefaults.ElevatedTrailingButton( checked = checked, onCheckedChange = { checked = it }, modifier = Modifier.semantics { stateDescription = if (checked) "Expanded" else "Collapsed" contentDescription = "Toggle Button" }, ) { val rotation: Float by animateFloatAsState( targetValue = if (checked) 180f else 0f, label = "Trailing Icon Rotation" ) Icon( Icons.Filled.KeyboardArrowDown, modifier = Modifier .size(SplitButtonDefaults.TrailingIconSize) .graphicsLayer { this.rotationZ = rotation }, contentDescription = null ) }})

## Button groups
Button groups organize buttons in a horizontal layout. They manage how buttons resize and animate when clicked. This enables buttons to expand and compress their neighbors in response to user interaction.

Here are some key features:

**Overflow Handling**: The **overflowIndicator **allows you to handle situations where the buttons don&#x27;t fit on the screen. This example demonstrates how to create a button group with an overflow indicator. When the screen is too small to display all the buttons, a More icon is displayed. Clicking this icon shows a menu with the remaining buttons.

val numButtons = 10ButtonGroup( overflowIndicator = { menuState -> IconButton( onClick = { if (menuState.isExpanded) { menuState.dismiss() } else { menuState.show() } } ) { Icon( imageVector = Icons.Filled.MoreVert, contentDescription = "Localized description" ) } }) { for (i in 0 until numButtons) { clickableItem(onClick = {}, label = "$i") }}**Toggleable Buttons**: You can create buttons that can be toggled (selected/deselected), supporting both single and multiple selection scenarios. This example shows how to create a button group where one button can be selected at a time.

val options = listOf("Work", "Restaurant", "Coffee") val unCheckedIcons = listOf(Icons.Outlined.Work, Icons.Outlined.Restaurant, Icons.Outlined.Coffee) val checkedIcons = listOf(Icons.Filled.Work, Icons.Filled.Restaurant, Icons.Filled.Coffee) var selectedIndex by remember { mutableIntStateOf(0) } ButtonGroup( modifier = Modifier.padding(horizontal = 8.dp), overflowIndicator = {} ) { options.forEachIndexed { index, label -> toggleableItem( checked = selectedIndex == index, onCheckedChange = { selectedIndex = index }, label = label, icon = { Icon( if (selectedIndex == index) checkedIcons[index] else unCheckedIcons[index], contentDescription = "Localized description" ) } ) }And now an example with multiple buttons selected at the same time:

val options = listOf("Work", "Restaurant", "Coffee") val unCheckedIcons = listOf(Icons.Outlined.Work, Icons.Outlined.Restaurant, Icons.Outlined.Coffee) val checkedIcons = listOf(Icons.Filled.Work, Icons.Filled.Restaurant, Icons.Filled.Coffee) val checked = remember { mutableStateListOf(false, false, false) } ButtonGroup( modifier = Modifier.padding(horizontal = 8.dp), overflowIndicator = {} ) { options.forEachIndexed { index, label -> toggleableItem( checked = checked[index], onCheckedChange = { checked[index] = it }, label = label, icon = { Icon( if (checked[index]) checkedIcons[index] else unCheckedIcons[index], contentDescription = "Localized description" ) } ) } }

# Conclusion
**Expressive design** is not just about aesthetics, its about improving usability. By using more dynamic colors, shapes, and animations, **Material 3** allows developers to create** Android UIs** that are more intuitive, engaging, and reflective of the users personal style.

The new components, like the **LoadingIndicator**, **SplitButtonLayout**, and **ButtonGroup**, provide practical tools for building these enhanced user experiences. As developers, embracing these changes will enable us to craft applications that are not only visually appealing but also more user-friendly and effective.

